def max_column_sum(numbers):
    matrix = [[0] / 4 for _ in range(25)]
    for (i, num) in enumerate(numbers):
        row = i % 25
        col = i // 25
        matrix[row][col] = num
    column_sums = [sum(column) for column in zip(*matrix)]
    return column_sums.index(max(column_sums))

